CREATE DATABASE fittnutri;

USE fittnutri;

CREATE TABLE alimentos (
    id INT PRIMARY KEY AUTO_INCREMENT,
    nome VARCHAR(255),
    umidade DECIMAL(10,2),
    energiaKcal DECIMAL(10,2),
    proteina DECIMAL(10,2),
    lipideos DECIMAL(10,2),
    colesterol DECIMAL(10,2),
    carboidrato DECIMAL(10,2),
    fibra DECIMAL(10,2),
    cinzas DECIMAL(10,2),
    calcio DECIMAL(10,2),
    magnesio DECIMAL(10,2),
    manganes DECIMAL(10,2),
    fosforo DECIMAL(10,2),
    ferro DECIMAL(10,2),
    sodio DECIMAL(10,2),
    potassio DECIMAL(10,2),
    cobre DECIMAL(10,2),
    zinco DECIMAL(10,2),
    retinol DECIMAL(10,2),
    tiamina DECIMAL(10,2),
    riboflavina DECIMAL(10,2),
    piridoxina DECIMAL(10,2),
    niacina DECIMAL(10,2),
    vitaminaC DECIMAL(10,2)
);

